import Loader from "../Loader"

const SectionHome = ({ randomSongs, handleSongSelect }) => {
  return (
    <section>
      <h1> Random songs </h1>
      {randomSongs
        ? <ul>
            {randomSongs.map(song =>
              <li key={song.id} onClick={() => handleSongSelect(song.id)}>
                {song.full_title}
              </li>
            )}
          </ul>
        : Loader
      }
    </section>
  )
}

export default SectionHome
